import React from 'react';
import './ExpenseForm.css';

const ExpenseForm=()=>{
    return(
        <form>

            <div>
                <label>title</label>
            <input name='Title' type='text'/>
            </div>
            <div><label>Amount</label>
            <input name='Amount' type='number'/>
            </div>
            <div><label>Date</label>
            <input name='Date'/></div>

        </form>
    );
}
export default ExpenseForm;
